import React from 'react';
import AfterCSS from '../After.module.css';

import Cards from '../Cards';


const AfterHome = () => {
  return (      
     <>
     <Cards/>
     <div className={AfterCSS.row}>
      <div className={AfterCSS.menu1}>
      <button type="button" className={AfterCSS.myExpense}>My Expense</button>
      <button type="button" className={AfterCSS.groupExpense}>Group Expense</button>
      <button type="button" className={AfterCSS.sett}>Settings</button>
      </div>
    
    <div className={AfterCSS.transaction}>
        Add Transaction..
      </div>
      
      <div className={AfterCSS.t_history}>
        Transaction History
      </div>
      </div>
      
      <div className='group'>
        <button type="button" className={AfterCSS.viewGroups}>View Groups</button>
        <div className={AfterCSS.addGroup}>Add Group</div>
      </div>
      
      </>
  );
}

export default AfterHome;
